css:
.term3 {
  overflow: hidden;
}
.term3 .terminal {
  padding: 0;
  overflow: auto;
}
.term3 .terminal > div {
  white-space: pre;
}
.term3 .terminal > div > span {
  display: inline-block;
  line-height: inherit;
  height: inherit;
  font-weight: normal !important;
}
.term3 .terminal .terminal-cursor {
  background-color: #fff;
}
.term3 .terminal span {
  white-space: pre;
}
.floobits-terminal {
  padding: 8px;
  font-family: Menlo, "Deja Vu Sans Mono", Consolas, monospace;
}
.floobits-terminal div {
  white-space: nowrap;
}
terminal-list-view {
  display: flex;
  margin-top: 10px;
}
terminal-list-view .header {
  margin-left: 21px;
}
terminal-list-view .header img {
  width: 22px;
  padding-right: 5px;
}
terminal-list-view ul {
  margin-left: -24px;
  list-style-type: none;
  margin-top: 5px;
}
